import { useSelector } from "react-redux";
let SocialHandleUi = () => {
    let social = useSelector(
        (state) => state.social
    );

    let details = useSelector((state) => state.details);
    console.log(social);
    let { fname} = details;
    let img = useSelector(state => state.userImage);
    return (
        <>
            <div class="profile">
                <img src={img} alt="" class="img-fluid rounded-circle" />
                <h1 class="text-light"><a href="index.html">{fname}</a></h1>
                <div class="social-links mt-3 text-center">

                    {
                        Object.keys({social}).map(function (key, index) {
                            {/* console.log(key); */}
                            {/* console.log(key); */}
                            return  <a href={social[key]} class="twitter"><i class="bx bxl-twitter"></i></a>
                        })
                    }
                    {/* <a href="." class="twitter"><i class="bx bxl-twitter"></i></a>
                    <a href="." class="facebook"><i class="bx bxl-facebook"></i></a>
                    <a href="." class="instagram"><i class="bx bxl-instagram"></i></a>
                    <a href="." class="google-plus"><i class="bx bxl-skype"></i></a>
                    <a href="." class="linkedin"><i class="bx bxl-linkedin"></i></a> */}
                </div>
            </div>

        </>
    )
}

export default SocialHandleUi;
